import React, {Component} from 'react'
import Youtube from 'react-youtube'

class RobotYoutubeLive extends Component {
    _onReady(event) {
        event.target.playVideoAt(50)
        console.log(event.target)
    }
    render() {
        const opts = {
            height: 390,
            width: 640,
            playerVars : {
                autoPlay: 1
            }
        }
        const videoID = this.props
        return (
            <Youtube
                videoID = {videoID}
                opts = {opts}
                onReady = {this._onReady}
            />
        )
    }


}
export default RobotYoutubeLive;
